import React from 'react';
import { FlagDefinitionsType, FlagValuesType } from '../index.js';

/**
 * @deprecated It is no longer necessary to render this component. Web Analytics now automatically detects flags present in the DOM.
 */
declare function FlagsReporter(props: {
    keys: string[];
}): null;

type Encrypted<T> = string;
/**
 * Registers variant definitions with the toolbar
 */
declare function FlagDefinitions({ definitions, }: {
    definitions: FlagDefinitionsType | Encrypted<FlagDefinitionsType>;
}): React.JSX.Element;
/**
 * Registers variant values with the toolbar
 */
declare function FlagValues({ values, }: {
    values: FlagValuesType | Encrypted<FlagValuesType>;
}): React.JSX.Element;

export { FlagDefinitions, FlagValues, FlagsReporter };
